import React, { useEffect, useState } from "react";
import axios from 'axios'
function Home() {
    const [data, setData]= useState([])
    useEffect(()=>{
        axios.get('http://http://localhost:8081/')
        .then(res => setData(res.data))
        .catch(err=> console.log(err));
    },[])
    return(
     <div>
        <div>
            <table>
                <thread>
                    <tbody>
                        <tr>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Action</th>
                        </tr>
                    </tbody>
                </thread>
                <tbody>
                    {
                        data.map((student, index)=> {
                            return <tr key={index}>
                                <td> {student.id}</td>
                                <td> {student.name}</td>
                                <td> {student.email}</td>
                            </tr>
                        })
                    }
                </tbody>
            </table>
        </div>
     </div> 
    )
}

export default Home
